import {useParams} from "react-router-dom";
import './WriteReviewCss.css';


const WriteReview = () => {

    const name = useParams().name;
    return(
        <>
        <div className="HelloWorld">Hello {name}</div>
        <div>제목<input type="text"></input></div>
        <div>작성자</div>

        </>
        
    )

}

export default WriteReview;
